import React from 'react'
import imgl from '--/asset/img/dashboard'

function Homepage() {
  return (
    <div classflame='container'> 
       <div classflame='leftcontainer'>
           <p>hii</p>
           <img src={imgl} />
       </div>
    
       <div classflame='rightcontainer'>
           <p>hello</p>
       </div>
    </div>
  );
}

export default Homepage
